import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import AdminNavbar from './AdminNavbar';
import api from '../../api/api';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';

// Register ChartJS components
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

function Analytics() {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [analytics, setAnalytics] = useState({
    documentsByMonth: [],
    aiScoreDistribution: [],
    userGrowth: [],
    uploadTimes: []
  });
  const navigate = useNavigate();

  useEffect(() => {
    const admin = JSON.parse(localStorage.getItem('admin') || '{}');
    if (!admin.id) {
      navigate('/admin/login');
      return;
    }

    fetchAnalytics();
  }, [navigate]);

  const fetchAnalytics = async () => {
    try {
      const response = await api.get('/admin/analytics');
      setAnalytics(response.data);
    } catch (err) {
      setError('Failed to load analytics data');
      console.error('Error:', err);
    } finally {
      setLoading(false);
    }
  };

  const documentUploadData = {
    labels: analytics.documentsByMonth.map(item => item.month),
    datasets: [{
      label: 'Document Uploads',
      data: analytics.documentsByMonth.map(item => item.count),
      borderColor: 'rgb(75, 192, 192)',
      tension: 0.1
    }]
  };

  const userGrowthData = {
    labels: analytics.userGrowth.map(item => item.month),
    datasets: [{
      label: 'New Users',
      data: analytics.userGrowth.map(item => item.count),
      borderColor: 'rgb(54, 162, 235)',
      tension: 0.1
    }]
  };

  return (
    <>
      <AdminNavbar />
      <div className="container mt-4">
        <div className="row mb-4">
          <div className="col">
            <h2>Analytics</h2>
          </div>
        </div>

        {error && (
          <div className="alert alert-danger" role="alert">
            {error}
          </div>
        )}

        {loading ? (
          <div className="text-center">
            <div className="spinner-border text-primary" role="status">
              <span className="visually-hidden">Loading...</span>
            </div>
          </div>
        ) : (
          <div className="row g-4">
            {/* Document Uploads Chart */}
            <div className="col-md-6">
              <div className="card shadow-sm">
                <div className="card-header bg-white">
                  <h5 className="card-title mb-0">Document Uploads Over Time</h5>
                </div>
                <div className="card-body">
                  <Line data={documentUploadData} options={{ responsive: true }} />
                </div>
              </div>
            </div>

            {/* User Growth Chart */}
            <div className="col-md-6">
              <div className="card shadow-sm">
                <div className="card-header bg-white">
                  <h5 className="card-title mb-0">User Growth</h5>
                </div>
                <div className="card-body">
                  <Line data={userGrowthData} options={{ responsive: true }} />
                </div>
              </div>
            </div>

            {/* AI Score Distribution */}
            <div className="col-md-12">
              <div className="card shadow-sm">
                <div className="card-header bg-white">
                  <h5 className="card-title mb-0">AI Score Distribution</h5>
                </div>
                <div className="card-body">
                  <div className="table-responsive">
                    <table className="table">
                      <thead>
                        <tr>
                          <th>Score Range</th>
                          <th>Number of Documents</th>
                          <th>Percentage</th>
                        </tr>
                      </thead>
                      <tbody>
                        {analytics.aiScoreDistribution.map(item => (
                          <tr key={item.range}>
                            <td>{item.range}</td>
                            <td>{item.count}</td>
                            <td>{item.percentage}%</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>

            {/* Upload Times Analysis */}
            <div className="col-md-12">
              <div className="card shadow-sm">
                <div className="card-header bg-white">
                  <h5 className="card-title mb-0">Peak Upload Times</h5>
                </div>
                <div className="card-body">
                  <div className="table-responsive">
                    <table className="table">
                      <thead>
                        <tr>
                          <th>Time Period</th>
                          <th>Number of Uploads</th>
                          <th>Average AI Score</th>
                        </tr>
                      </thead>
                      <tbody>
                        {analytics.uploadTimes.map(item => (
                          <tr key={item.period}>
                            <td>{item.period}</td>
                            <td>{item.uploads}</td>
                            <td>{item.avgScore}%</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    </>
  );
}

export default Analytics;
